  //padding: 20,
  border: '1px solid #DDD',
  height: '350px',

  margin: 'auto',
  backgroundColor: '#f2f2f2',
};

const FeatureLayout = props => (
  <div>
    <div style={layoutStyle}>
      <Feature />
      {props.children}
    </div>
  </div>
);

export default FeatureLayout;
